# Step 6: Build tokenize function
# convert input question into a list of tokens
def tokenize(question, max_sequence_length):
  tokens = [token.text for token in eng.tokenizer(question)]

  # converts each token string to its corresponding index in the vocab
  sequence = [vocab[token] for token in tokens]

  if len(sequence) < max_sequence_length:
    sequence += [vocab['<pad>']] * (max_sequence_length-len(sequence))
  else:
    sequence= sequence[:max_sequence_length]

  return sequence

