import numpy as np
class VQADataset(Dataset):
  def __init__(self, data, classes_to_idx, max_seq_len=30, transform=None, root_dir='/content/val2014-resised'):
    self.transform = transform
    self.data = data
    self.max_seq_len = max_seq_len
    self.root_dir = root_dir
    self.classes_to_idx = classes_to_idx


  def __len__(self):
    return len(self.data)

  def __getitem__(self, index):
    # item = self.data[index]
    # image_path = item['image_path']
    # question = item['question']
    # answer = item['answer']
    img_path = os.path.join(self.root_dir, self.data[index]['image_path'])

    img = Image.open(img_path).convert('RGB')
    if self.transform:
      img = self.transform(img)
    question = self.data[index]['question']
    question = tokenize(question, self.max_seq_len)
    question = torch.tensor(question, dtype=torch.long)

    label = self.classes_to_idx[self.data[index]['answer']]
    label = torch.tensor(label, dtype=torch.long)
    return img, question, label

